const dummyData = [
    {
        ticketNumber: 1,
        category: "React",
        title: "Issue with setting up state",
        description: "I can't get my state to render",
        effort: "I tried to use curly brackets",

    },
    {
        ticketNumber: 2,
        category: "Back End",
        title: "How to set up API?",
        description: "I don't know where to start!",
        effort: "Set up Zoom call with Nate to get some help",
    },
    {
        ticketNumber: 3,
        category: "SASS",
        title: "Problem importing reactstrap with SASS",
        description: "I am not sure how to use both SASS and Reactstrap together",
        effort: "I tried Import the Reactstrap component",
    },
    {
        ticketNumber: 4,
        category: "Animation",
        title: "How to install GSAP",
        description: "I am getting an error message in my terminal when I try to install GSAP",
        effort: "I have tried npm install gsap but that didn't work",
    },
    {
        ticketNumber: 5,
        category: "Back End",
        title: "How to send an email when the user submits the form?",
        description: "I can't get my terminal to accept my firebase init command",
        effort: "I tried watching some online tutorials but I haven't figured it out",
    },
    {
        ticketNumber: 6,
        category: "React",
        title: "How to pass props?",
        description: "I can't get my props to render in my child component",
        effort: "I tried to refactor my code and added props as arguments in my function",
    },
];

export default dummyData;
